import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AppAdmin from './administrador/AppAdmin';
// Importa otros roles aquí (por ejemplo, AppResidente, AppSeguridad) si es necesario

const App = () => {
    return (
        <Router>
            <Routes>
                {/* Rutas para el administrador */}
                <Route path="/*" element={<AppAdmin />} />

                {/* Aquí podrías agregar rutas para otros tipos de usuario */}
                {/* <Route path="/residente/*" element={<AppResidente />} /> */}
                {/* <Route path="/seguridad/*" element={<AppSeguridad />} /> */}
            </Routes>
        </Router>
    );
};

export default App;
